import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import styles from "./app.module.css";
import { Main } from "./pages";

function App() {
  return (
    <Router>
      <Link to="/main">Home</Link>
      <Route path="/main" component={Main} />
    </Router>
  );
}

export default App;
